sion der Schweiz (Weko) nimmt Kooperationsvereinbarungen zwischen dem f\xFChrenden Telekommunikationsunternehmen Swisscom und \xF6rtlichen Stromversorgern beim Bau von Glasfasernetzen unter die Lupe. Die Swisscom hatte Mitte 2009 angek\xFCndigt, in Ballungsr\xE4umen mit Fibre-to-the-Home (FTTH) k\xFCnftig voll auf Glasfaser zu setzen. Bis 2015 will der Konzern die St\xE4dte Z\xFCrich, Genf, Basel, St. Gallen, Bern, Lausanne und den Kanton Freiburg fl\xE4chendeckend mit FTTH versorgen. Dabei setzt die Swisscom nicht nur auf selbst installierte Glasfaserinfrastrukturen, sondern das Unternehmen will nach M\xF6glichkeit auch Infrastrukturen nutzen, die bereits von \xF6rtlichen Elektrizit\xE4tsversorgern aufgebaut wurden, die den Ausbau eigener Glasfasernetze zuletzt stark vorangetrieben hatten. Und dies ist Wettbewerbern ein Dorn im Auge. So reichte etwa der Verband der Kabelnetzbetreiber, Swisscable, im Mai 2010 Beschwerde bei der Weko wegen eines Kooperationsvertrages zwischen der Stadt St. Gallen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",kyc='Dimension',Ljc='Dimension [height=',zuc='DirectionalTextHelper',Cuc='DockLayoutPanel',Duc='DockLayoutPanel$Direction',Euc='DockLayoutPanel$Direction;',Huc='DockLayoutPanel$DockAnimateCommand',Fuc='DockLayoutPanel$LayoutData',Oqc='DomEvent',Tqc='DomEvent$Type',Uwc='Double',Lgc='EAST',Ebc='EEE, d MMM yyyy HH:mm:ss Z',Dmc='EEE. dd MMM. yyyy HH:mm:ss',Ybc='EEEE, MMMM d',Hbc='EEEE, MMMM d, y',d9b='EM',Oec='EMPTY',Tec='ENABLED',jdc='END',f9b='EX',htc='ElementMapperImpl',itc='ElementMapperImpl$FreeNode',$cc='English',$pc='Enum',Rcc='Etc/GMT',Tcc='Etc/GMT+',Scc='Etc/GMT-',y9b='Event type',$vc='Event$NativePreviewEvent',erc='EventBus',opc='EventObject',tpc='Exception',pfc='Expecting version 6 from server, got ',vac='F',Mkc='F8834F07517EF3B7D02B9E845E5E1B88',$8b='FIXED',Nfc='FLOAT',rkc='Fail: ',Pac='Feb',Dac='February',hoc='Female',Vwc='Float',Iuc='FlowPanel',guc='FocusWidget',Nic='For input string: "',rbc='Fri',kbc='Friday',M9b='GET',Umc='GGD55XLBAH',Foc='GGD55XLBAJ',Snc='GGD55XLBBI',Tmc='GGD55XLBCH',Unc='GGD55XLBCI',pec='GGD55XLBDB',Smc='GGD55XLBDH',Ooc='GGD55XLBDJ',Bnc='GGD55XLBDK',cec='GGD55XLBEB',Qmc='GGD55XLBEH',Tnc='GGD55XLBEI',Goc='GGD55XLBEJ',qec='GGD55XLBFB',Xmc='GGD55XLBFH',poc='GGD55XLBFI',fpc='GGD55XLBFK',moc='GGD55XLBGI',dpc='GGD55XLBGK',tec='GGD55XLBHB',dnc='GGD55XLBHH',aoc='GGD55XLBHI',cpc='GGD55XLBHK',fnc='GGD55XLBIH',_oc='GGD55XLBIK',enc='GGD55XLBJH',amc='GGD55XLBJJ',epc='GGD55XLBJK',qnc='GGD55XLBKG',Nnc='GGD55XLBKH',qoc='GGD55XLBKI',Woc='GGD55XLBKK',nnc='GGD55XLBLG',Mnc='GGD55XLBLH',ioc='GGD55XLBLI',Xoc='GGD55XLBLK',unc='GGD55XLBMG',Lnc='GGD55XLBMH',emc='GGD55XLBMJ',snc='GGD55XLBNG',Knc='GGD55XLBNH',Voc='GGD55XLBNK',Hlc='GGD55XLBOG',Onc='GGD55XLBOH',wmc='GGD55XLBOJ',Ilc='GGD55XLBPG',coc='GGD55XLBPI',_Ac='GWTcom',Ozc='GWTcomConstants_en',Mzc='GWTcomGi
